import React from 'react';
import Wallet from '../components/Wallet';
import '../styles/Wallets.css';

const Wallets = () => {
    return (
        <div className="wallet__container">
            <div className="wallet__header">Wallets</div>

            <div className="wallet__box">
                <Wallet name='Windows 32-Bit' message='Installer'/>
                <Wallet name='Windows 64-Bit' message='Installer'/>
                <Wallet name='macOS' message='Installer'/>
                <Wallet/>
                <Wallet/>
            </div>
        </div>
    )
}

export default Wallets
